import React from 'react';
import { Col, Button, Menu, Row } from 'antd';
import pet1 from './pet1.png';
import './App.css';

function App() {
  const onChange = (currentSlide: number) => {
    console.log(currentSlide);
  };

  return (
    <div className="App">
      <div className='OurPets'>
        <div>
          <Menu mode="horizontal" className='Menu'>
            <Menu.Item key="home">
              <a href="/">Home</a>
            </Menu.Item>
            <Menu.Item key="about">
              <a href="/about">About</a>
            </Menu.Item>
            <Menu.Item key="contact">
              <a href="/contact">Contact</a>
            </Menu.Item>
          </Menu>
        </div>
        <Row gutter={{ xs: 8, sm: 16, md: 24, lg: 32 }}>
          <Col span={12}>
            <h1>No solo las personas necesitan una casa</h1>
            <p className='Descripcion'> Blacky es un perrito lindo, cariñoso y muy jugueton. Si buscas un compañero de paseo el es la mejor opción</p>
            <Button type="primary" shape="round" className='Button'>
              Hazte su amigo
            </Button>
          </Col>
          <Col span={12}>
            <img src={pet1} alt="pet1" />
          </Col>
        </Row>
      </div>

    </div>
  );
}

export default App;
